def minPath(grid, k):
    n = len(grid)
    visited = [[False] * n for _ in range(n)]
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def isValid(x, y):
        return 0 <= x < n and 0 <= y < n

    def dfs(x, y, path):
        if len(path) == k:
            return path

        visited[x][y] = True
        min_path = None

        for dx, dy in directions:
            new_x, new_y = x + dx, y + dy
            if isValid(new_x, new_y) and not visited[new_x][new_y]:
                new_path = dfs(new_x, new_y, path + [grid[new_x][new_y]])
                if min_path is None or new_path < min_path:
                    min_path = new_path

        visited[x][y] = False
        return min_path

    for i in range(n):
        for j in range(n):
            path = dfs(i, j, [grid[i][j]])
            if path:
                return path

